import './App.css';

function Tarjeta() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h2 className="Titulo">Hola Mundo!</h2>
      </header>
    </div>
  );
}

export default Tarjeta;
